	/**
	 * 计算拼牛份数及每份价格
	 * 每头牛的份数有可能随时改变,相对的每份价格也会跟着变化
	 * 剩余可投金额不能被份数每份金额整除时,向下取整,使余数加在最后一份中
	 * 以此原则计算每期本金,利息,剩余可投,剩余利息等
	 * @return
	 * @throws Exception
	 */
	
	/**
	 * 剩余可投金额
	 * 总金额-已投金额
	 * @return
	 */
	public BigDecimal getResidueAmount() {
		//总金额-已投金额
		return BigDecimal.valueOf(this.getTotalAmount()).subtract( BigDecimal.valueOf(this.getInvestedAmount()));
	}
	
	/**
	 * 平均每份售价
	 * 如果不能整除,向下取整到分位
	 * @return
	 */
	private BigDecimal getPinAverageAmountPerPoint() {
		//floor(总金额/总份数,2);
		return BigDecimal.valueOf(this.getTotalAmount()).divide(BigDecimal.valueOf(this.getPinTotalPoint()),2,BigDecimal.ROUND_FLOOR);
	}
	
	/**
	 * 已投份数
	 * 总份数-剩余可投份数
	 * @return
	 */
	public Integer getPinInvestedPoint(){
		//总份数-剩余份数
		return this.getPinTotalPoint()-this.getPinResiduePoint();
	}
	
	/**
	 * 剩余可投份数
	 * 剩余可投份数=剩余可投金额/平均每份售价
	 * 如果 剩余可投金额 除不尽,余数算在最后一份里,即非整数的份数向下取整
	 * 当调小份数,平均每份售价会变大,此时份数可能=0,所以如果有剩余可投金额,至少剩余1份可投
	 * @return
	 */
	public Integer getPinResiduePoint() {
		//floor(剩余可投金额/平均每份售价)
		BigDecimal residuePoint = this.getResidueAmount().divide(getPinAverageAmountPerPoint(),BigDecimal.ROUND_FLOOR);
		//如果有剩余可投金额,至少剩余1份
		if(residuePoint.compareTo(BigDecimal.ZERO)<=0 &&  this.getResidueAmount().compareTo(BigDecimal.ZERO)>0) {
			residuePoint=BigDecimal.ONE;
		}
		return residuePoint.intValue();
	}
	
	/**
	 * 当前每份售价
	 * 返回平均每份售价
	 * 当只剩一份时,返回剩余可售金额
	 * @return
	 */
	public BigDecimal getPinAmountPerPoint() {
		return getPinAmountForPoint(1);
	}
	
	/**
	 * 按传入的份数,计算售价
	 * @param point 份数
	 * @return
	 * @throws Exception 
	 */
	public BigDecimal getPinAmountForPoint(Integer point) {
		if(point.equals(this.getPinResiduePoint())) {
			//剩余可投金额
			return this.getResidueAmount();
		}else {
			///平均每份售价*份数
			return this.getPinAverageAmountPerPoint().multiply(BigDecimal.valueOf(point));
		}
	}
	
	/**
	 * 剩余利润
	 * 当只剩一份时,返回剩余可售金额的利润
	 * @return
	 */
	public BigDecimal getPinResidueInterest() {
		return BigDecimal.valueOf(this.getInterestAmount()).multiply(this.getResidueAmount()).divide(BigDecimal.valueOf(this.getTotalAmount()),2,BigDecimal.ROUND_FLOOR);
	}
	
	/**
	 * 按传入的份数,计算占比
	 * @param point 份数
	 * @return
	 * @throws Exception 
	 */
	public BigDecimal getPinRateForPoint(Integer point) {
		//份数售价/总售价
		return getPinAmountForPoint(point).divide(BigDecimal.valueOf(this.getTotalAmount()), 10,BigDecimal.ROUND_FLOOR);
	}
	
	/**
	 * 预计每份利润
	 * 当只剩一份时,返回剩余可售金额的利润
	 * @return
	 */
	public BigDecimal getPinInterestPerPoint() {
		if(this.getPinResiduePoint().equals(1)) {
			//剩余利润
			return this.getPinResidueInterest();
		}else {
			//floor(总利息/总份数,2)
			return BigDecimal.valueOf(this.getInterestAmount()).divide(BigDecimal.valueOf(this.getPinTotalPoint()),2,BigDecimal.ROUND_FLOOR);
		}
	}

	/**
	 * 按传入的份数,计算利润
	 * 当只剩一份时,返回剩余可售金额的利润
	 * @return
	 */
	public BigDecimal getPinInterestForPoint(Integer point){
		if(point.equals(this.getPinResiduePoint())) {
			//剩余利润
			return this.getPinResidueInterest();
		}else {
			//每份利润*份数
			return this.getPinInterestPerPoint().multiply(BigDecimal.valueOf(point));
		}
	}
	
	/**
	 * 按传入的订单金额,计算占比
	 * @param point 份数
	 * @return
	 * @throws Exception 
	 */
	public BigDecimal getPinRateForAmount(BigDecimal amount) {
		//份数售价/总售价
		return amount.divide(BigDecimal.valueOf(this.getTotalAmount()), 10,BigDecimal.ROUND_FLOOR);
	}
